import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHouse } from '@fortawesome/free-solid-svg-icons';
import { faUser } from '@fortawesome/free-solid-svg-icons';
import { faBagShopping } from '@fortawesome/free-solid-svg-icons';
import { faCertificate } from '@fortawesome/free-solid-svg-icons';
import { faTrophy } from '@fortawesome/free-solid-svg-icons';

import NavbarComponent from './customComponents/NavbarComponent';
import HeaderComponent from './customComponents/HeaderComponent';
import FooterComponent from './customComponents/FooterComponent';
import AboutLanding from './customComponents/AboutLanding';
import CertificationsLanding from './customComponents/CertificationsLanding';
import ECommerceSection from './customComponents/ECommerceSection';

function App() {
  return (
    <>
      <NavbarComponent
        navLinks={[
          { title: 'Home', href: '#home', icon: <FontAwesomeIcon icon={faHouse} /> },
          { title: 'About', href: '#about', icon: <FontAwesomeIcon icon={faUser} /> },
          { title: 'Certifications', href: '#certifications', icon: <FontAwesomeIcon icon={faTrophy} /> },
          { title: 'Products', href: '#shop', icon: <FontAwesomeIcon icon={faBagShopping} /> },
          { title: 'Reviews', href: '#reviews', icon: <FontAwesomeIcon icon={faCertificate} /> },
        ]}        
      />
      <HeaderComponent
        content={[
          { title: 'Matteo Migliarese', subtitle: "Web developer & Web designer", href: "#abc", cta: "Scarica il mio CV"}
      ]}/>
      <AboutLanding showMusicSection />
      <CertificationsLanding/>
      <ECommerceSection/>
      <FooterComponent/>
    </>
  );
}

export default App;
